    out.writeString("\r\n<div id=\"AboutBlock\">\r\n\r\n    <img class='titleImg' src=\"/img/aboutus-title.gif\" alt=\"news\"/>\r\n\r\n    <div class=\"underLineA\">\r\n        <img class=\"vertLine\" src=\"/img/vertical-line.gif\" alt=\"\"/>\r\n    </div>\r\n\r\n    <div id=\"aboutTxt\">\r\n\r\n        <p>ООО «Гиперком-Проект» специализируется на проектировании жилых и административных зданий,\r\n            бизнес-центров, торгово-развлекательных центров. </p>\r\n\r\n        <p>Среди объектов проектирования выполненных нашими специалистами можно отметить – бизнес-центр\r\n            «Порт»\r\n            (26 этажей, площадь 54 000кв.м.), бизнес-центр «Немига-Сити» (14 этажей, площадь 70000 кв.м.),\r\n            торгово-развлекательный комплекс «Западный» (15 600кв.м.). Также мы занимаемся проектированием\r\n            объектов жилого фонда – многоэтажные (до 26 этажей) жилые комплексы со встроенной\r\n            инфраструктурой.\r\n            Качество проектных работ подтверждается Дипломом Республиканского конкурса профессионального\r\n            признания за проект бизнес-центра «Немига Сити». </p>\r\n\r\n        <p>Работа во взаимодействии с девелоперскими компаниями позволяет нам глубже ориентироваться на\r\n            нужды\r\n            клиента, оптимально сочетая такие важные для него факторы как сроки, качество и стоимость\r\n            проектных\r\n            работ. </p>\r\n\r\n        <p>Мы предлагаем свое сотрудничество в сфере проектирования интересующих Вас объектов, гарантируя\r\n            качество выполнения работ на уровне международных стандартов. </p>\r\n\r\n        <p>Мы выполняем все стадии проекта по всем разделам, начиная с разработки эскизного проекта,\r\n            заканчивая\r\n            получением заключения органов экспертизы.</p>\r\n\r\n        <p> Среди наших крупных заказчиков можно отметить: </p>\r\n\r\n\r\n        <ul class=\"vacancyList\">\r\n            <li> КУП “Управление капитального строительства Советского райо